#include <bits/stdc++.h>
#define pii pair<int, int>
#define ff first
#define ss second
#define _ ios_base::sync_with_stdio(false);cin.tie(NULL);cout.tie(NULL);
 
using namespace std;
 
int main(){ _

    int n, u, b; cin >> n >> u >> b;

    queue<pii> q;
    for(int i = 0; i < n; i++){
        int x; cin >> x;
        q.push({x, i});
    }
    vector<int> type(n);
    for(int i = 0; i < n; i++) cin >> type[i];

    int v = 0;
    vector<bool> foi(n, false);
    while(!q.empty()){
        auto qt = q.front();

        if(type[qt.ss]){ // carregar
            if(!u && !foi[qt.ss]){
                foi[qt.ss] = true;
                q.push(qt);
            } else {
                // retiro o min entre o (disponvel no estoque, caixas que o caminho consegue levar)
                u -= min(qt.ff / b, u);
            }
        } else { // descarregar
            v += qt.ff;
            u += v/b;
            v %= b;
        }

        q.pop();
    }

    cout << (u * b) + v << endl;
 
    return 0;
}

