#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;


void DFS(const vector<vector<int>>& list_graph, vector<bool>& visited, int vertex) {

	visited[vertex] = true;

	for (int u : list_graph[vertex]) {
		if (!visited[u]) {
			DFS(list_graph, visited, u);
		}
	}

}

int main() {

	int N, X, M;
	cin >> N >> X >> M;

	if (N == 1) cout << 0; 

	vector<vector<int>> list_graph(N + 1);
	vector <vector <int>> matrix_graph(N + 1, vector <int>(N + 1));


	for (int i = 0; i < M; ++i) {

		int vertex_1, vertex_2, weight;
		cin >> vertex_1 >> vertex_2 >> weight;
		list_graph[vertex_1].push_back(vertex_2);
		matrix_graph[vertex_1][vertex_2] = -weight;

	}

	vector<bool> visited(N + 1, false); 

	DFS(list_graph, visited, X);

	for (int i = 1; i < N + 1; ++i) {
		if (visited[i] == false) { cout << -1; return 0; }
	}

	const int INF = 101;
	for (int i = 0; i < N + 1; i++) {
		for (int j = 0; j < N + 1; j++) {

			if (matrix_graph[i][j] == 0 && i != j) {
				matrix_graph[i][j] = INF;
			}
		}
	}

	for (int k = 0; k < N + 1; k++) {
		for (int i = 1; i < N + 1; i++) {
			for (int j = 1; j < N + 1; j++) {
				if (matrix_graph[i][k] < INF && matrix_graph[k][j] < INF)
				{
					matrix_graph[i][j] = min(matrix_graph[i][j], matrix_graph[i][k] + matrix_graph[k][j]);
				}
			}
		}
	}

	cout << -*min_element(matrix_graph[X].begin(), matrix_graph[X].end()) << '\n';

	//for (int i = 0; i < N+1; i++) {
	//	for (int j = 0; j < N+1; j++) {
	//		cout << matrix_graph[i][j] << ' ';
	//	}
	//	cout << '\n';
	//}
}
