bot.use(session({
  store: {
    get: (key) => {
      return new Promise((resolve, reject) => {
        connection.query(
          'SELECT * FROM sessions WHERE session_key = ?',
          [key],
          (error, results) => {
            if (error) {
              reject(error);
            } else {
              const sessionData = results[0] ? JSON.parse(results[0].session_data) : {};
              resolve(sessionData);
            }
          }
        );
      });
    },
    set: (key, data) => {
      return new Promise((resolve, reject) => {
        const sessionData = JSON.stringify(data);
        connection.query(
          'INSERT INTO sessions (session_key, session_data) VALUES (?, ?) ON DUPLICATE KEY UPDATE session_data = ?',
          [key, sessionData, sessionData],
          (error) => {
            if (error) {
              reject(error);
            } else {
              resolve();
            }
          }
        );
      });
    },
    delete: (key) => {
      return new Promise((resolve, reject) => {
        connection.query(
          'DELETE FROM sessions WHERE session_key = ?',
          [key],
          (error) => {
            if (error) {
