#include <iostream>
#include <cmath>
#include <vector>
#include <numeric>
const int s_ = 1e6 + 1e4;
const int cnst = 77;

size_t hash1(const std::string& key) {
    int sum = std::accumulate(key.begin(), key.end(), 0);
    return sum % s_;
}

size_t hash2(const std::string& key) {
    size_t hashVal = 0;
    int p = 1;
    for (char c : key) {
        hashVal = (hashVal + (c + 1) * p);
        p = (p * cnst);
    }
    return hashVal % s_;
}

bool check(const std::vector<std::string>& table, const std::string& x) {
    int ind1 = hash1(x);
    int ind2 = hash2(x);
    return (table[ind1] == x || table[ind2] == x);
}

void insert(const std::string& x, std::vector<std::string> &table, int *points, int n) {
    std::string temp = x;
    bool flag = false;
    int cnt = 0;
    while (true) {
        size_t ind1 = hash1(temp);
        size_t ind2 = hash2(temp);
        if (table[ind1].empty() || table[ind1] == temp) {
                table[ind1] = temp;
                if (!flag) {
                    points[n] += 3;
                }
                return;
        } else if (table[ind2].empty() || table[ind2] == temp) {
                table[ind2] = temp;
                if (!flag) {
                    points[n] += 3;
                }
                return;
        } else {
            flag = true;
            std::string temp2 = table[ind1];
            table[ind1] = temp;
            temp = temp2;
            if (cnt == 0) {
                points[n] += 3;
                cnt++;
            }
        }
    }
}
