    ArrayToNumb(array_first, number_first);
    ArrayToNumb(array_second, number_second);

    string ans = addStrings(number_first, number_second);

    cout << '[';
    for (int i = 0; i < ans.size(); ++i) {

        cout << ans[i];
        if (i != ans.size() - 1) { cout << ", "; }

    }
    cout << ']';
}
