void insert(int hashtable[], int x, int num)
{
    int k = 0;
    int mod = 0, primod = 0;
    bool found = false;
    while (!found)
    {
        if (k == 0)
        {
            mod = x % num;
            primod = mod;
        }
        else
        {
            mod = (primod + k) % num;
        }

        if (hashtable[mod] == 0)
        {
            found = true;
            hashtable[mod] = x;
        }
        k++;
    }
}

