class bitreader {
	uint8_t buffer_;
	uint8_t n_ = 0;
	std::istream& is_;

public:
	bitreader(std::istream& is) : is_(is) {}

	template <typename T>
	T read_bit() {
		if (n_ == 0) {
			raw_read(is_, buffer_);
			n_ = 8;
		}
		--n_;
		return (buffer_ >> n_) & 1;
	}

	template <typename T>
	T read(uint8_t n) {
		T u = 0;
		while (n-- > 0) {
			u = (u << 1) | read_bit<T>();
		}
		return u;
	}

	template <typename T>
	T operator()(uint8_t n) {
		return read(n);
	}

	bool fail() const {
		return is_.fail();
	}

	explicit operator bool() const {
		return !fail();
	}
};
